INSERT INTO `game` VALUES (1,'배틀','안녕핫헤','',25000,0,'2019-12-02 00:00:00','블루','액','Y','N',NULL,0,'N'),(2,'123123','1213','',123123,0,'2012-12-12 00:00:00','2','333','Y','N',NULL,0,'N'),(3,'서든어택','ㅇㅇㅇ','<p><br></p>',5000,0,'2020-01-19 00:00:00','1','ㅇㅇㅇ','Y','N',NULL,0,'N'),(4,'0204테스트','안녕하세요','<p><br></p>',50000,0,'2021-02-03 00:00:00','1','만들어야함','Y','N',NULL,0,'N'),(5,'폴가이즈','안녕하세요','<p><br></p>',30000,0,'1997-11-01 00:00:00','1','만들어야댐','Y','N',NULL,0,'N'),(6,'배틀그라운드 테스트','ㅎㅇㅎㅇㅎㅇ','',50000,0,'2020-12-12 00:00:00','2','ㅇㅇㅇ','Y','N',NULL,0,'N'),(7,'배틀그라운드 테스트2','ㅇㅇㅇㅇㅇ','<p><br></p>',25500,0,'2016-11-01 00:00:00','1','ㅇㅇㅇ','Y','N',NULL,0,'N'),(8,'테스트0205','ㄴㅇㅎ','',33000,0,'2021-02-05 00:00:00','2','ㅈㅁㅎ','N','N',NULL,0,'N'),(10,'배그상세11','서브내용입니다','<p style=\"text-align: center; \"><img style=\"width: 600px;\" src=\"data:image/jpeg;base64,\" data-filename=\"배틀그라운드1.jpg\"></p><p style=\"text-align: left;\">테스트입니다</p><p style=\"text-align: center;\"><img style=\"width: 600px;\" src=\"data:image/jpeg;base64,\" data-filename=\"배틀그라운드4.jpg\"><br></p><p style=\"\">Insurgency: Sandstorm은 근거리 전투와 목표를 중심으로 한 팀 기반 전술 FPS 멀티플레이 게임입니다. 유명 인디 FPS 게임 Insurgency의 후속작인 Sandstorm은 모든 면이 개선되고, 확장되고, 더 커진 모습으로 다시 태어났습니다. 실력으로 승부하고 팀워크로 승리하는 현대 전투의 긴박함을 느껴보십시오. 막강한 탄도학과 경장갑차, 포격을 경험할 수 있는 HDR 오디오가 적용된 하드코어 게임입니다.</p><h2 class=\"bb_tag\" style=\"padding-top: 2px; margin-top: 18px; margin-bottom: 0px; line-height: 26px; background-image: none; background-repeat: no-repeat; background-position: left bottom;\">현대전의 공포를 일깨우는 긴박한 전장</h2><p>중동 지역에서 발생한 가상의 무력 충돌 상황에서 빠르고 조심스럽게 움직이십시오. 죽음은 시도때도 없이 찾아오고, 남은 탄환에 주의를 기울여야 하며, 전술적으로 움직여야 승리할 수 있습니다.</p><h2 class=\"bb_tag\" style=\"padding-top: 2px; margin-top: 18px; margin-bottom: 0px; line-height: 26px; background-image: none; background-repeat: no-repeat; background-position: left bottom;\">더욱 향상되고 확장된 Insurgency</h2><p>Insurgency 시리즈 최초로 다양한 복장, 장신구, 음성으로 캐릭터를 꾸밀 수 있습니다. 아군과 함께 화력 지원을 요청하거나 차량에 탑재된 기관총으로 적과 싸울 수도, 빠르게 진행되는 소규모 경쟁 경기를 치를 수도 있습니다. 새로운 무기와 업그레이드로 적을 압도하십시오.</p><h2 class=\"bb_tag\" style=\"padding-top: 2px; margin-top: 18px; margin-bottom: 0px; line-height: 26px; background-image: none; background-repeat: no-repeat; background-position: left bottom;\">실감 나는 전투</h2><p>가장 현실적인 FPS라는 Insurgency의 명성에 걸맞게, Sandstorm 역시 언리얼 엔진 4 덕분에 근거리 전투를 더 실감 나게 체험할 수 있습니다. 실력으로 승부하는 만큼 생존이 가장 중요합니다. 모든 반동과 충격을 느껴보십시오.<br></p>',35000,0,'1984-11-01 00:00:00','1','3454325','Y','N',NULL,0,'N'),(11,'배그','ㅎㅎㅎㅎ','<p>ㅎㅎㅎㅎㅎ</p>',20200,0,'2020-12-02 00:00:00','2','ㄴㅁㅎ','Y','N',NULL,0,'N'),(12,'1241','123123','<p>1242152</p>',235235,0,'2023-12-08 00:00:00','1','12412','Y','N',NULL,0,'N'),(13,'35325','123123','<p>123123</p>',235235,0,'2016-11-01 00:00:00','1','123','N','N',NULL,0,'N'),(14,'Skul: The Hero Slayer','Skul: The Hero Slayer는 2D 로그라이트 액션 플랫포머 게임입니다. 마왕성 경비를 맡고있는 꼬마 스켈레톤 \'스컬\'은 인간들에게 붙잡혀간 마왕을 구하기 위해 용사와 모험가 그리고 제국군에 홀로 맞서 싸우기 시작합니다.','<h2 class=\"bb_tag\" style=\"padding-top: 2px; margin-top: 18px; margin-bottom: 0px; line-height: 26px; font-size: 15px; background-image: none; background-repeat: no-repeat; background-position: left bottom; font-family: &quot;Motiva Sans&quot;, sans-serif;\"><font color=\"#000000\">배경</font></h2><p><font color=\"#000000\"><span style=\"font-family: &quot;Motiva Sans&quot;, sans-serif; font-size: 14px;\">언제나 그래왔듯이 이번에도 인간들은 마왕성을 습격하였습니다.</span><span style=\"font-family: &quot;Motiva Sans&quot;, sans-serif; font-size: 14px;\">평소와 다른게 있다면 모험가들 뿐 아니라 초대용사와 제국군까지 합류하여 총공격으로 마왕성을 초토화시키는데 성공했다는 점이죠.</span><br style=\"font-family: &quot;Motiva Sans&quot;, sans-serif; font-size: 14px;\"><span style=\"font-family: &quot;Motiva Sans&quot;, sans-serif; font-size: 14px;\">마왕을 비롯한 마왕성의 모든 마족들은 인간들에게 붙잡혀 갔으며 왕좌 앞에는 작은 스켈레톤의 뼈만이 남아있었습니다.</span></font><br></p>',27000,0,'2018-05-05 00:00:00','1','5325','N','N',NULL,0,'M'),(15,'등록실험 (수정)','Fall Guys는 한 명의 승자가 남을 때까지 계속되는 혼란스러운 60인 난투극 멀티플레이 파티 게임입니다!','<p><span style=\"font-family: &quot;Motiva Sans&quot;, sans-serif; font-size: 14px;\"><font color=\"#000000\">Fall Guys: Ultimate Knockout는 한 명의 승자가 나올 때까지 혼란스러운 라운드를 이어가는 정신 나간 60인 멀티플레이 파티 게임입니다. 기괴한 장애물과 싸우고, 무자비한 경쟁자를 쓰러뜨리고, 대단한 물리 엔진을 극복하세요. 품위는 내던지고 승자의 왕관을 위해 우스꽝스러운 실패에 대비하세요!</font></span><br></p>',23000,0,'2021-01-04 00:00:00','1','123','N','N',NULL,0,'M'),(16,'구매연습','올해의 게임 175여 개를 수상하고 250개 이상의 완벽한 평가를 받은 Red Dead Redemption 2는 현대 시대가 시작될 무렵 무법자인 아서 모건과 악명 높은 반 더 린드 갱단이 미국 전역을 따라 도주하는 장대한 서사시입니다. 모두가 함께 즐길 수 있는 생생한 세계인 Red Dead 온라인 역시 포함됩니다.','<p><font color=\"#000000\"><span style=\"font-family: &quot;Motiva Sans&quot;, sans-serif; font-size: 14px;\">1899년 미국.</span><br style=\"font-family: &quot;Motiva Sans&quot;, sans-serif; font-size: 14px;\"><br style=\"font-family: &quot;Motiva Sans&quot;, sans-serif; font-size: 14px;\"><span style=\"font-family: &quot;Motiva Sans&quot;, sans-serif; font-size: 14px;\">아서 모건과 반 더 린드 갱단은 도주 중인 무법자입니다. 정부 요원과 일류 현상금 사냥꾼들에게 추격당하는 그들은 살아남기 위해 강도질과 도둑질, 싸움을 거듭하며 미국의 험난한 심장부를 달려 나갑니다. 심해져 가는 내부 갈등으로 갱이 해체될 위기 속에서, 아서는 자기를 키워 준 갱에 대한 의리와 자신의 이상 중 하나를 선택해야만 합니다.</span><br style=\"font-family: &quot;Motiva Sans&quot;, sans-serif; font-size: 14px;\"><br style=\"font-family: &quot;Motiva Sans&quot;, sans-serif; font-size: 14px;\"><span style=\"font-family: &quot;Motiva Sans&quot;, sans-serif; font-size: 14px;\">이제 추가 스토리 모드 콘텐츠와 사진 모드를 완벽히 즐길 수 있는 Red Dead Redemption 2에서 모두가 함께 즐길 수 있는 생생한 세계인 Red Dead 온라인을 무료로 플레이할 수 있습니다. 플레이어는 여러 개의 직업을 맡아 개척지에서 자신만의 독특한 길을 개척해나갈 수 있습니다. 현상금 사냥꾼이 되어 범죄자를 추적할 수 있고, 상인이 되어 사업을 운영할 수 있습니다. 아니면 수집가가 되어 이국적인 보물을 발굴하거나 밀주업자가 되어 비밀스러운 양조장을 운영하는 등 다양한 활동을 할 수 있습니다.</span><br style=\"font-family: &quot;Motiva Sans&quot;, sans-serif; font-size: 14px;\"><br style=\"font-family: &quot;Motiva Sans&quot;, sans-serif; font-size: 14px;\"><span style=\"font-family: &quot;Motiva Sans&quot;, sans-serif; font-size: 14px;\">더욱 깊이 몰입할 수 있도록 완전히 새롭게 향상된 그래픽과 기술적인 요소를 갖춘 PC용 Red Dead Redemption 2는 PC의 성능을 최대로 활용하여 이 방대하고 풍부하며 생생한 세계의 구석구석에 생명을 불어넣었습니다. 늘어난 가시거리, 고품질의 글로벌 일루미네이션과 주변 폐색으로 개선된 낮과 밤의 조명, 반사 효과 향상, 어떤 거리에서도 더 깊이 있고 높은 해상도의 그림자, 테셀레이션 나무 텍스처, 향상된 잔디와 모피 텍스처 등이 모든 식물과 동물에 사실감을 불어넣습니다.</span><br style=\"font-family: &quot;Motiva Sans&quot;, sans-serif; font-size: 14px;\"><br style=\"font-family: &quot;Motiva Sans&quot;, sans-serif; font-size: 14px;\"><span style=\"font-family: &quot;Motiva Sans&quot;, sans-serif; font-size: 14px;\">PC용 Red Dead Redemption 2는 HDR을 지원하며, 4K 이상의 해상도나 다중 모니터 설정, 와이드 스크린 설정, 고속 주사율 등 하이엔드 디스플레이 설정에서 실행할 수 있는 기능을 제공합니다.</span></font><br></p>',7000,0,'2020-12-11 00:00:00','1','ㅇㅇ','N','N',NULL,0,'M'),(17,'Football Manager 2021','새롭게 추가되는 기능과 게임 업그레이드로 깊이와 드라마, 축구의 진정성을 전합니다. FM21에서 그 어느 때보다도 강력한 권한으로 감독 기량을 발전시키고 클럽을 성공으로 이끄세요.','<p><font color=\"#000000\" style=\"background-color: rgb(255, 255, 255);\"><span style=\"font-family: &quot;Motiva Sans&quot;, sans-serif; font-size: 14px;\">감독은 모든 축구 클럽의 심장입니다. Football Manager 2021에서는 플레이어를 중심에 둔 다이나믹하고 현실감 넘치는 감독 체험 및 차원이 다른 디테일로, 엘리트에 도달하기 위한 모든 것을 선사합니다.</span><br style=\"font-family: &quot;Motiva Sans&quot;, sans-serif; font-size: 14px;\"><br style=\"font-family: &quot;Motiva Sans&quot;, sans-serif; font-size: 14px;\"><span style=\"font-family: &quot;Motiva Sans&quot;, sans-serif; font-size: 14px;\">50개 이상의 국가, 2,500개 이상의 축구 클럽 등 다양한 수준의 팀을 선택할 수 있어 무한한 가능성을 경험할 수 있습니다. 이제 선택은 여러분의 몫입니다.</span><br style=\"font-family: &quot;Motiva Sans&quot;, sans-serif; font-size: 14px;\"><br style=\"font-family: &quot;Motiva Sans&quot;, sans-serif; font-size: 14px;\"></font></p><ul class=\"bb_ul\" style=\"margin-bottom: 0px; margin-left: 16px; list-style-type: square; list-style-position: inside; font-family: &quot;Motiva Sans&quot;, sans-serif; font-size: 14px;\"><li style=\"margin-bottom: 8px; list-style-position: outside;\"><font color=\"#000000\" style=\"background-color: rgb(255, 255, 255);\">자신만의 색깔로 스스로의 포부에 걸맞는 도전을 해보십시오. 팀의 체계와 조화를 이루어 나가세요... 그렇지 않으면 좌절을 맛볼 수도 있습니다.<br></font></li><li style=\"margin-bottom: 8px; list-style-position: outside;\"><font color=\"#000000\" style=\"background-color: rgb(255, 255, 255);\">이적 시장에 발을 담그기 전에 백룸 스탭과 힘을 합쳐 선수단의 강점과 선수층 깊이를 평가하세요. 감독님의 아카데미에는 1군 팀의 문을 두드릴 신성이 있을 겁니다...<br></font></li><li style=\"margin-bottom: 8px; list-style-position: outside;\"><font color=\"#000000\" style=\"background-color: rgb(255, 255, 255);\">전략 전술, 포메이션, 플레이 스타일을 모든 상황에 맞춰 치밀하게 구성하여, 클럽의 승리 확률을 최대화하고 이 세 가지 측면을 발전시키세요.<br></font></li><li style=\"margin-bottom: 8px; list-style-position: outside;\"><font color=\"#000000\" style=\"background-color: rgb(255, 255, 255);\">야심 찬 계획이 빛을 발하는 것을 보면서, 감독의 영광을 누리고 매치 데이의 스펙터클에 빠져 보세요.</font></li></ul><p style=\"margin-bottom: 8px; list-style-position: outside;\"><font color=\"#000000\" style=\"background-color: rgb(255, 255, 255);\"><br></font></p><p style=\"margin-bottom: 8px; list-style-position: outside;\"><font color=\"#000000\" style=\"background-color: rgb(255, 255, 255);\"><br></font></p><p style=\"margin-bottom: 8px; list-style-position: outside;\"><span style=\"font-family: &quot;Motiva Sans&quot;, sans-serif; font-size: 14px; background-color: rgb(255, 255, 255);\"><font color=\"#000000\" style=\"\">선수 및 언론과의 소통이 명확한 목적에 따라 더욱 현실적으로 진행됩니다. 제스처를 통해 감정을 표현할 수 있고, 빠른 대화를 통해 감독으로서 일상적이고 짧은 비격식적 대화를 나눌 수 있죠. FM21에서 감독의 말은 본인의 성격을 형성하고 다른 사람에게 영향을 줍니다.</font></span></p><p style=\"margin-bottom: 8px; list-style-position: outside;\"><font color=\"#000000\" style=\"background-color: rgb(255, 255, 255);\"><span style=\"font-family: &quot;Motiva Sans&quot;, sans-serif; font-size: 14px;\">이제 지금까지 가장 뛰어난 매치 엔진으로 모든 경기 일정이 더욱 사실적이고 생동감 있게 구현됩니다. 경기 전 전술 수립을 위해 더욱 향상된 분석 자료와 조언을 받을 수 있으며, 이렇게 한층 업그레이드된 경기 자료와 새롭게 모델링된 경기 UI가 더해져 이제껏 볼 수 없었던 사실적인 액션을 선사합니다.</span><br style=\"font-family: &quot;Motiva Sans&quot;, sans-serif; font-size: 14px;\"><br style=\"font-family: &quot;Motiva Sans&quot;, sans-serif; font-size: 14px;\"><span style=\"font-family: &quot;Motiva Sans&quot;, sans-serif; font-size: 14px;\">FM21은 그 외에도 그라운드 내외의 AI를 전반적으로 대폭 개선했습니다. 의사 결정의 폭도 넓어졌으며, 플레이어의 결정에 대한 뉘앙스도 더해져 그런 뉘앙스에 반응하는 빠른 의사 결정을 내릴 수 있게 됩니다. 이렇게 개선된 의사 결정 과정 덕분에 더 나은 수비 및 골키퍼 지능과 향상된 필드 중앙 플레이, 그리고 다양해진 공격 영역 플레이가 가능해졌습니다.</span><br style=\"font-family: &quot;Motiva Sans&quot;, sans-serif; font-size: 14px;\"><br style=\"font-family: &quot;Motiva Sans&quot;, sans-serif; font-size: 14px;\"><span style=\"font-family: &quot;Motiva Sans&quot;, sans-serif; font-size: 14px;\">또한 매치 후에도 팀에서 만든 기회에 대비해 얼마나 경기력이 좋거나 나빴는지 알려주는 완전히 새로운 SIxG 시스템 등을 비롯해 더 많은 반응과 데이터를 받아볼 수 있습니다.</span></font></p><h2 class=\"bb_tag\" style=\"padding-top: 2px; margin-top: 18px; margin-bottom: 0px; line-height: 26px; font-size: 15px; background-image: none; background-repeat: no-repeat; background-position: left bottom; font-family: &quot;Motiva Sans&quot;, sans-serif;\"><font color=\"#000000\" style=\"background-color: rgb(255, 255, 255);\">분석 및 통계</font></h2><p style=\"margin-bottom: 8px; list-style-position: outside;\"><span style=\"font-family: &quot;Motiva Sans&quot;, sans-serif; font-size: 14px; background-color: rgb(255, 255, 255);\"><font color=\"#000000\" style=\"\">데이터 관련 개선 사항은 매치데이에만 편중되어있지 않고, 매치 전 준비를 향상에도 도움을 줍니다. 올해는 실제 감독들이 받아보는 데이터를 미러링한 새로운 \'경기력 분석가\'의 월간 리포트를 비롯하여 훨씬 더 많은 양의 데이터 보고가 감독 여러분에게 제공됩니다. 새로운 그래프와 데이터 맵 덕분에 팀의 강점과 상대의 약점에 대해 더 명확한 인사이트를 받아볼 수 있으며, 그라운드 전반을 분석한 새로운 통계 개요도 선보입니다.</font></span><span style=\"font-family: &quot;Motiva Sans&quot;, sans-serif; font-size: 14px; background-color: rgb(255, 255, 255);\"><font color=\"#000000\" style=\"\"><br></font></span><font color=\"#000000\" style=\"background-color: rgb(255, 255, 255);\"><br></font></p>',54000,37800,'2020-11-22 00:00:00','1','1212','N','Y',NULL,0,'M'),(18,'날짜 이상하게등록되는거 확인','1244','<p>124124</p>',30000,0,'2000-11-01 00:00:00','1','124','Y','N',NULL,0,'N'),(19,'123123','ㄴㅇㅎㄴㅁㅇㅎ','<p>ㄴㅇㅁㅎㅁㄴㅇㅎ</p>',20000,0,'2021-01-05 00:00:00','2','ㄴㅇㅁ','Y','N',NULL,0,'N'),(20,'213123','234234','<p>234234</p>',235235,0,'2222-11-22 00:00:00','2','234','Y','N',NULL,0,'N'),(21,'234234','','<p><br></p>',235235,0,'2012-12-12 00:00:00','2','','Y','N',NULL,0,'N'),(22,'234234','','<p><br></p>',235235,0,'2222-11-22 00:00:00','2','','Y','N',NULL,0,'N'),(23,'asdf','d','<p><br></p>',235235,0,'2012-12-11 00:00:00','2','d','Y','N',NULL,0,'N'),(24,'ARK: Survival Evolved','신비한 섬 기슭에 좌초 된 당신은 살아남는 법을 배워야합니다. 교활함을 사용하여 땅을 배회하는 원시 생물을 죽이거나 길들이고 다른 플레이어와 만나 생존하고 지배하며 탈출하세요!','<h3><b>공룡, 생물, 번식! -야생 생물을 약화시켜 무의식 상태로 두드린 다음 적절한 음식으로 건강 상태로 되 돌리는 등 도전적인 포획 및 친 화성 프로세스를 사용하여 100 개 이상의 생물을 길들일 수 있습니다. 길 들여진 후에는 길 들여진 명령을 내릴 수 있으며,이를 얼마나 잘 길들이고 훈련했는지에 따라 따를 수 있습니다. 레벨 업을 계속하고 식량을 소비 할 수있는 테이 메는 또한 인벤토리와 갑옷과 같은 장비를 운반 할 수 있고, 그들의 힘에 따라 당신의 정착지로 먹이를 되돌릴 수 있으며, 더 큰 길들이기를 타고 직접 제어 할 수 있습니다! 눈 덮인 산 위로 익룡을 비행하고, 적의 벽을 넘어 아군을 들어 올리고, 랩터 팩으로 정글을 질주하고, 거대한 브론토 사우루스를 따라 적 기지를 밟거나, 격렬한 T- 렉스의 뒤에서 먹이를 쫓아 내세요! 자신의 포식자 및 먹이 계층 구조로 역동적 인 생태계 라이프 사이클에 참여하세요. 당신은 지배력과 생존을 위해 고군분투하는 많은 종들 중 하나에 불과합니다. Tames는 또한 재조합 유전 유전에 기반한 형질 시스템을 사용하여 연속적인 세대를 선택적으로 번식시키기 위해 반대 성별과 짝짓기를 할 수 있습니다.&nbsp;</b></h3>',51000,30600,'2017-08-27 00:00:00','2','ㅎㅎ','N','Y',NULL,0,'N'),(25,'Raft','뗏목은 당신과 당신의 친구들을 장대 한 해양 모험으로 던집니다! 혼자 또는 함께 플레이어는 광활한 바다를 가로 지르는 위험한 항해에서 살아 남기 위해 전투를 벌입니다! 잔해물을 모으고 암초를 청소하고 자신 만의 떠 다니는 집을 지으십시오. 그러나 식인 상어를 조심하십시오!','<h3><b>혼자서 또는 친구들과 함께, 당신의 임무는<br></b><b>위험한 바다! 생존을 위해 잔해를 모으고 뗏목을 확장하고 위험에주의하십시오.<br></b><b>바다!</b><b><br></b><b>낡은 플라스틱으로 만든 갈고리 밖에없는 작은 뗏목에 갇혀 플레이어는 광대 한 곳에서 깨어 있습니다.<br></b><b>푸른 바다는 완전히 혼자이고 땅이 보이지 않습니다! 목이 마르고 위가 공복하면<br></b><b>생존은 쉽지 않을 것입니다!</b><b><br></b><b>뗏목은 당신과 당신의 친구들을 넓은 바다에서 장대 한 모험을 떠나게합니다.<br></b><b>살아남고 자원을 모으고<br></b><b>활착.</b><b><br></b><b>자원은 바다에서 구하기가 어렵습니다. 플레이어는 믿을 수있는 갈고리를 사용하여 떠 다니는 잔해물을 반드시 잡아야하며 가능하면 파도 아래의 암초와 위의 섬을 청소해야합니다.<br></b><b>그러나 갈증과 배고픔이 바다의 유일한 위험은 아닙니다. 남자를 조심하세요.<br></b><b>당신의 항해를 끝내기로 결심 한 상어 먹기!이 과정에는 계란 기반 배양과 포유류 임신 수명주기가 모두 포함됩니다! 또는 더 간단하게 말해서 아기를 키우십시오!</b></h3>',21000,14700,'2018-05-23 00:00:00','2','dd','N','Y',NULL,0,'N'),(26,'플래닛 코스터','Planet Coaster® - 코스터 공원 시뮬레이션 게임의 미래가 도래했습니다! 코스터 공원의 제국을 건설하여 환상적인 손님들에게 놀라움과 기쁨, 스릴을 선사하세요. 상상의 나래를 마음껏 펼치고 성공적인 작품을 세상에 공유하세요.','<p>꿈의 테마 공원을 건설하며 손님들에게 놀라움과 기쁨, 스릴을 선사하세요. 세밀한 디테일까지도 공을 들여 엄청난 롤러코스터 공원을 건설하고 설계하며 진정 살아있는 세계에서 공원을 관리하세요.</p><p>부분별 아이템으로 건설: Planet Coaster에서는 누구나 디자이너가 될 수 있습니다. 보행로를 만들고, 풍경을 꾸미고, 기구를 직접 꾸며 보세요. 천 개가 넘는 건설 재료를 하나씩 쌓아 나만의 색다른 공원을 만드세요.</p><p><br></p><p>자유로운 지형 변경: 자연을 마음껏 변경하며 발밑의 땅 모양을 바꿔보세요. 지형을 깎아내어 산이나 호수를 만들고 동굴을 파낼 수 있으며 심지어는 하늘 위에 섬도 만들 수 있습니다. 지형을 변형시켜 지상과 지하를 넘나드는 코스터를 만드세요.</p><p><br></p><p>진정한 시뮬레이션: 좋아하는 기구를 재현하거나, 현실에선 찾아볼 수 없는 기구를 만들어 보세요. 플레이 방법에 상관없이, 최고로 현실적인 기구와 최고로 현실적인 손님들의 반응으로 Planet Coaster는 진정한 시뮬레이션으로 거듭납니다.</p>',48000,0,'2021-02-04 00:00:00','2','ㅁㄶ','N','N',NULL,0,'N'),(27,'영원회귀: 블랙서바이벌','영원회귀: 블랙서바이벌은 전략, 컨트롤, 그리고 멋진 캐릭터들을 경험하실 수 있는 쿼터뷰 스타일의 독특한 배틀로얄 게임입니다. 지속적으로 추가되는 캐릭터들과 함께 루미아섬에서 다른 17명의 플레이어들과 경쟁을 즐겨보세요. 솔로플레이와 듀오/스쿼드의 팀플레이 모두 가능합니다.','<p>제작, 전투, 그리고 생존</p><p>세상과는 떨어진 섬 루미아에서, 과학집단 아글라이아가 인간을 대상으로 신인류가 되기 위한 비밀스러운 생존 실험을 벌입니다.생존에 필요한 무기와 방어구를 제작해, 17명의 다른 생존자들을 쓰러트리고 마지막까지 살아남아보세요.</p><p>전작 블랙서바이벌의 세계관을 공유하는 영원회귀는, 배틀로얄, MOBA, 서바이벌이 융합된 새로운 형태의 게임입니다.</p><div><br></div>',35000,14000,'2021-02-10 00:00:00','2','ㄴㅇㅁㅎ','N','Y',NULL,0,'M'),(28,'Stardew Valley','Stardew Valley에서 할아버지의 오래된 농장 부지를 물려 받았습니다. 손수 도구와 몇 개의 동전으로 무장 한 당신은 새로운 삶을 시작하기 시작했습니다. 땅에서 살며 자란 들판을 번성하는 집으로 바꾸는 법을 배울 수 있습니까?','<p>Stardew Valley에서 할아버지의 오래된 농장 부지를 물려 받았습니다. 손수 도구와 몇 개의 동전으로 무장 한 당신은 새로운 삶을 시작하기 시작했습니다. 땅에서 살며 자란 들판을 번성하는 집으로 바꾸는 법을 배울 수 있습니까? 쉽지 않을 것입니다. Joja Corporation이 마을에 온 이후로 옛 삶의 방식은 거의 사라졌습니다. 한때 마을에서 가장 활기 넘치는 활동의 중심지였던 커뮤니티 센터는 이제 혼란에 빠졌습니다. 그러나 계곡에는 기회가 가득한 것 같습니다. 약간의 헌신으로 Stardew Valley를 위대하게 복원하는 사람이 될 수 있습니다!<br></p>',23000,18400,'2021-01-24 00:00:00','2','ㅇㅇ','N','Y',NULL,0,'N'),(29,'포커스 유','설레는 여름날처럼 그녀가 다가왔다. 반짝이는 우리의 시간, 한유아가 당신을 찾아갑니다.','<p>고3. 사진전공. 카페 알바생.</p><p>평범한 일상을 살아가던 당신.</p><p><br></p><p>어느 무더운 여름날, 출사를 위해 나온 공원. 평소와 다를 바 없을 것 같은 하루였는데…</p><p>하지만 그곳에서 당신이 마주친 건 동화 속에서 막 나온 것 같은 귀여운 여학생이었다.</p><p>그녀는 흔쾌히 사진 모델이 되어주지만, 부끄러운 듯 곧 사라져 버리는데…</p><p><br></p><p>다음날 그녀는 당신이 일하는 카페에 나타나 전속 사진 작가가 되어 달라고 한다.</p><p><br></p><p>그녀는 사진을 찍어줄 사람이 필요한 것뿐일까?</p><p>아니면… 혹시 내게 호감이 있는걸까?</p><p><br></p><p>“누구나 한번쯤은 간직하고 있을 첫 사랑의 기억을 VR로 리마인드”</p><p>포커스온유는 누구나 한번쯤은 가지고 있을만한 첫 사랑의 추억을 떠올릴 수 있게 만들어 드립니다. 나만의 VR 공간 안에서 다시 고등학생으로 돌아가 풋풋했던 첫 사랑과의 기억을 꺼내어 보세요. 설렘 가득한 대화, 수학여행의 추억, 그리고 심쿵한 순간을 다시 한번 느껴볼 수 있습니다.</p><p><br></p><p>“여 주인공과 대화를 통해 교감하는 감성 커뮤니케이션”</p><p>여 주인공 \'한유아\'와 대화를 통하여 나의 목소리를 전달할 수 있습니다. 음성 인식 기술을 통하여 나의 목소리로 직접 ‘한유아’에게 떨리는 마음을 전해보세요.</p><p>그녀와의 대화 한마디 한마디에서 실제와 같은 두근거림이 다가올 것입니다.</p><p><br></p><p>“일상 안에서의 소중한 추억을 사진으로 기록”</p><p>포커스온유는 소중한 첫사랑의 다양한 모습을 사진으로 담아낼 수 있습니다. 전문가가 아니더라도 쉽게 사진을 찍을 수 있도록 실제 사진기의 기능을 간단하고 쉽게 구현하였습니다.</p><p>‘한유아’와의 추억을 사진으로 기록하며 그녀만을 위한 앨범을 만들어 보세요. 여러분의 추억을 보다 아름답게 만들 수 있도록 고 퀄리티의 아름다운 배경과 세계를 여러분께 제공해 드립니다.</p>',18000,0,'2021-02-14 00:00:00','2','111','N','N',NULL,0,'N');
